import styled from "styled-components";

export const Container = styled.div`
    text-align: center;
   background-color: #EAEAEA;
   width: 200px;
   border: 1px solid black;
   border-radius: 5px;
   box-shadow: 10px 10px 20px black;
    div {
       img {
           max-width: 150px;
       }
   }
`;
